import { useState } from "react";

const LysLapskaus = (props) => {

    const [showResults, setShowResults] = useState(false);
    const onClick = () => {
        const newResult = showResults === 'false' ? 'true' : 'false';
        props.changeDiv(newResult);
        setShowResults(true);
    }

    return (
        <div>
            <h5>Porsjon (gram)  100</h5>

            <div class="bg-light">

                <form class="table table-striped">
                            <label scope="col" className="table-font">Energi eller næringsstoff</label>
                            <label scope="col" className="table-font">Mengde (gram)</label>

                            <label scope="row" className="table-font">Energi (kj)</label>
                                <input type="text" aria-label="First name" class="form-control"></input>

                </form>

            </div>

            <div class="col-12 button-div">
                <button type="submit" class="btn btn-primary btn-lg button-search" onClick={onClick}>Søk</button>
            </div>
        </div>

    )
};

export default LysLapskaus;
